import './App.css';
import React from 'react';
import Routing from "./screen/Routing"
import { Container } from "reactstrap"
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import HomeScreen from "./screen/HomeScreen"
import ItemDetail from "./screen/ItemDetailScreen"
import ItemBuy from "./screen/ItemBuyScreen"
import Menu from "../menuComponent/menu/MenuComponent"



function App() {

  return(
    <Container fluid={true} className="p-0 m-0">
        <Router>
            <Menu />
            <Switch>
                <Route path="/" exact component={HomeScreen} />

                <Route path="/details" component={ItemDetail} />

                <Route path="/buy" component={ItemBuy} />
            </Switch>
        </Router>
    </Container>
  );
}

export default App;
